import React from 'react';
import './App.css';

function App() {
const h2Style = {
  color: "red",
  fontSize : "10px"
}
  return (
    <div className="App">
      <header className="App-header">
        <h1 style = {{ color:"green", fontSize:"20" }}>Welcome to MERN-STACK APP DEVLOPMENT</h1>
        <h2 style={h2Style}>This is frontend</h2>
      </header>
    </div>
  );
}

export default App;
